import React from 'react';
import CompatibilityChecker from './components/CompatibilityChecker';

function App() {
  return (
    <div className="App">
      <header>
        <img src="/user.webp" alt="logo" className="user"/>
        <div className="text">
          <span>LOGIN</span>
          <span>Registra</span>
        </div>
      </header>
    </div>
  );
}

export default App;
